export namespace movies {
    namespace model {
        namespace instance {
            namespace state {
                const name: string;
                const noname: boolean;
                const genre: string;
                const movies: any[];
            }
        }
        const rules: {
            "#/state/name": {
                set: string;
                value: string;
            }[];
            "#/state/add": {
                set: string;
                value: (context: any) => any;
            }[];
        };
    }
    const pages: {
        label: string;
        fields: ({
            type: string;
            layout: string;
            fields: ({
                type: string;
                autocomplete: {
                    items: string[];
                };
                bind: string;
                label: string;
                required?: undefined;
                disabled?: undefined;
            } | {
                type: string;
                bind: string;
                required: boolean;
                label: string;
                autocomplete?: undefined;
                disabled?: undefined;
            } | {
                type: string;
                label: string;
                bind: string;
                disabled: string;
                autocomplete?: undefined;
                required?: undefined;
            })[];
            items?: undefined;
        } | {
            type: string;
            layout: string;
            items: string;
            fields: {
                type: string;
                layout: string;
                fields: ({
                    type: string;
                    layout: string;
                    fields: ({
                        type: string;
                        label: string;
                        size: number;
                        bind: string;
                        autocomplete?: undefined;
                        readonly?: undefined;
                    } | {
                        type: string;
                        label: string;
                        autocomplete: {
                            items: string[];
                        };
                        readonly: boolean;
                        bind: string;
                        size?: undefined;
                    } | {
                        type: string;
                        bind: string;
                        label: string;
                        size?: undefined;
                        autocomplete?: undefined;
                        readonly?: undefined;
                    })[];
                    label?: undefined;
                    click?: undefined;
                } | {
                    type: string;
                    label: string;
                    click: (e: any) => void;
                    layout?: undefined;
                    fields?: undefined;
                })[];
            }[];
        })[];
    }[];
}
